NHS ArdenGEM CSU seeks bids from suitably qualified providers for the provision of for a clinical occupational health and well-being service to include the following. 
The provision of the occupational health and well-being service should:
-	Be delivered by a team of skilled, multi-disciplinary health at work champions providing health advice associated with work;
-	Employ sufficient, appropriately qualified staff to ensure that the services are provided in all respects in accordance with the service specification. The Provider should ensure that a sufficient reserve of staff is available to meet the service specification during holidays or absences, even if the service demand appears minimal. 
-	Provide an excellent clinical service, with consistent and reliable support for managers and staff;
-	Provide timely intervention and rehabilitation, including assessing the impact of work on individuals' health, and the impact of the individual's health on their work;
-	Contribute to reducing the incidence of illness and injury caused by work;
-	Promote well-being;
-	Engage in assessing health needs and designing services to support them, alongside contributing to health at work related strategies;
-	Provide an online referral system, accessible to all staff.
-	Maintain a vaccination recall system on a monthly basis;
-	To assist the CCGs, and the Authorities in discharging its duties and responsibilities and general support in connection with the occupational health of its employees.
-	Measure performance of the service against agreed key performance indicators and provide regular activity reports to the Authorities for the purpose of management/Board reports where required;
-	Provide information to support the CCG or the Authorities in the production of their annual quality account, which includes demonstrating commitments to staff in line with the NHS Constitution, where applicable.
-	To provide the Authorities with an annual audit plan and provide periodic reports demonstrating actions that have been taken as a result of audit.

Additional information: How to Express Interest in this Tender: 1. Register your company on the eSourcing portal (this is only required once). 
Browse to the eSourcing Portal: https://ardengemcsu.bravosolution.co.uk and click the link to register.
Accept the terms and conditions and click 'continue' Enter your correct business and user details Note the user-name you chose and click 'Save' when complete. You will shortly receive an e-mail with your unique password (please keep this secure) 
 2. Express an Interest in the tender - Login to the portal with the user-name/password and Click the 'ITTs Open To All Suppliers' link. (These are ITTs open to any registered supplier) . Click on correct tender to access the content.
Click the 'Express Interest' button at the top of the page. - This will move the ITT into your 'My ITTs page. (This is a secure area reserved for your projects only) - You can now access any attachments by clicking 'Buyer Attachments' in the 'ITT/ Details' box

The ITT number is ITT_899

Please note that whilst within this advert we have included the RFP including the Service Specification and evaluation criteria you must respond via the Bravo e-procurement portal www.ardengemcsu.bravosolution.co.uk.

This Notice serves to announce the issue of Contract Award. It is not to seek expressions of interest for a new opportunity.
The Defence Infrastructure Organisation (DIO) is seeking expressions of interest, via the completion of the Pre Qualification Questionnaire, from Potential Providers (PPs) for managing and delivering the Soft Facilities Management services (Soft FM) detail in this advert, at sites within the South West region where the Ministry of Defence (MOD) operates covering the counties of Cornwall, Devon, Dorset, Somerset, Bristol, Wiltshire,Gloucestershire and part of Hampshire. This Contract is seventh of a number of regional contracts which will be advertised as part of Project HESTIA over two years, which will deliver Soft FM to MOD sites across the UK. PPs must be in a position to bid for the entirety of this contract, whether as a single prime contractor or as a Special Purpose Vehicle/consortium of organisations acting together to deliver the services.
The services required are detailed below, but they may not be required at every site within the region:
Swimming Pool Administration;
Gymnasium and Sports Facilities;
Mail Room;
Photographic, Graphic and Reprographic Services;
Stores and Supply Services;
Establishment Access;
Military mess and non-mess based catering/other short term catering;
Military functions;
Retail;
Refreshments services;
Military mess accommodation/hotel services (including cleaning and bookings);
Cleaning, general and specialist;
Domestic Assistance;
Waste Management;
Tailoring;
Cobbling;
Reception services;
Labour/porterage;
Laundry/porterage;
Laundry/Dry Cleaning;
Portable Toilets;
Verger Support;
Tele-communications Support Service;
Administrative Support Services;
Weapons and Munitions Storage.
In addition to the required services above, there is a business opportunity to provide additional retail and leisure at each of the sites, including unofficial and private functions.
This competition will be conducted under the Competitive Negotiated Procedure and in accordance with the Defence and Security Public Contract Regulations (2011). PPs should note that once the contract has been placed, the negotiated procedure without prior publication might be adopted for the procurement of new services which constitute a repetition of similar services carried out under the original contract.

Additional information: Contract Award & ITN documents added in line with with the transparency agenda commitment. Certain information has been redacted due to its personal, commercially sensitive or secure nature.  How to apply - Please apply directly to the Buyer using the contact details provided.
